import React from "react";

const Header = () => {
  return (
    <div className="header">
      <a>Spanish</a>

      <input type="search"></input>

      <button>
        <img
          src="https://www.freepnglogos.com/uploads/search-png/search-very-basic-icon-ios-iconset-icons-7.png"
          width="20px"
        ></img>
      </button>
    </div>
  );
};

export default Header;
